import React from "react"

class App extends React.Component {

  render() {
    return (
      <div className="wrapper">
        <div className="aboutMe">
          <div className="aboutMeImage">
            <img src="me.png" />
          </div>
          <div className="aboutMeText">
          </div>
        </div>
      </div>
    )
  }

}

export default App
